import 'bootstrap/dist/css/bootstrap.min.css';
import './Navbar.css';
import { useState } from 'react'; // Import useState if not already imported

const Navbar = () => {
  // State to manage dropdown visibility
  const [showDropdown, setShowDropdown] = useState(false);

  return (
    <nav className="navbar navbar-expand-lg navbar-blue bg-body-tertiaryy" data-bs-theme="dark">
      <div className="container-fluid">
        <a className="navbar-brand" href="#">
          <h1>Company Name</h1>
        </a>
        <button className="navbar-toggler" type="button" data-bs-toggle="collapse" data-bs-target="#navbarSupportedContent" aria-controls="navbarSupportedContent" aria-expanded="false" aria-label="Toggle navigation">
          <span className="navbar-toggler-icon"></span>
        </button>
      </div>
      <div className="collapse navbar-collapse" id="navbarSupportedContent">
        <ul className="navbar-nav me-auto mb-2 mb-lg-0">
          <li className="nav-item text-start"> 
            <a className="nav-link active fw-bold text-dark" aria-current="page" href="#">Home</a>
          </li>
          <li className="nav-item text-start dropdown"> 
            {/* Use 'showDropdown' state to control visibility */}
            <a className="nav-link dropdown-toggle fw-bold text-dark" href="#" onClick={() => setShowDropdown(!showDropdown)}>Services</a>
            {/* Conditionally render the dropdown menu */}
            {showDropdown && (
              <ul className="dropdown-menu" aria-labelledby="navbarDropdown">
                <li><a className="dropdown-item" href="#">Service 1</a></li>
                <li><a className="dropdown-item" href="#">Service 2</a></li>
                <li><hr className="dropdown-divider" /></li>
                <li><a className="dropdown-item" href="#">More Services</a></li>
              </ul>
            )}
          </li>
          {/* Other navigation items */}
        </ul>
      </div>
    </nav>
  );
};

export default Navbar;
